bull; Puissance moteur: 1 CV</p>\r\n\r\n<p>&bull; Tension: 220V-240V</p>\r\n\r\n<p>&bull; Mode veille (Sleep mode)</p>\r\n\r\n<p>&bull; Red&eacute;marrage automatique</p>\r\n\r\n<p>&bull; Garantie: 12 Mois</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>Climatisateur tr&eacute;s &eacute;conome proche de la technologie inverter et adapt&eacute; &agrave; notre pays. En effet 9 000 BTU est equivalent &agrave; 1&nbsp;cheval ce qui est suffisant pour une chambre ou encore votre salon&nbsp;jusqu&#39;&agrave;&nbsp;30m2</p>\r\n\r\n<p>La climatisation n&rsquo;est pas un luxe, mais un investissement dans son confort et sa qualit&eacute; d&rsquo;air int&eacute;rieur. M&ecirc;me en ouvrant vos fen&ecirc;tres, et selon l&rsquo;exposition de votre maison, il est difficile de rafra&icirc;chir pleinement et tout au long de la journ&eacute;e et nuit votre habitat.</p>\r\n\r\n<p>B&eacute;n&eacute;ficier d&#39;un confort imm&eacute;diat en p&eacute;riode de forte chaleur. Que ce soit pour vous, votre famille ou encore vos employ&eacute;s, vivre ou travailler dans une atmosph&egrave;re trop chaude et humide n&rsquo;est pas agr&eacute;able et n&rsquo;offrira que de moins bonnes conditions de travail ou de vie. Avec un abaissement de temp&eacute;rature de 6 &agrave; 8&deg;C, l&#39;air int&eacute;rieur est plus frais et moins moite.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>Indispensable en &eacute;t&eacute;, voire tout au long de l&#39;ann&eacute;e, le climatiseur permet de rafra&icirc;chir votre int&eacute;rieur (salon, chambre, bureau), afin de vous apporter du confort au quotidien. De la solution mobile &agrave; la version fixe, de l&rsquo;option monobloc &agrave; la formule split finies les nuits blanches &agrave; tourner dans son lit parce qu&#39;il y fait trop chaud. Gr&acirc;ce &agrave; l&#39;installation d&#39;un climatiseur dans votre domicile, vous dormirez comme un b&eacute;b&eacute;.</p>\r\n\r\n<p>Pour ne pas engager de travaux d&rsquo;installation ni de r&eacute;agencement d