o_WSC3560G24PSS_Catalyst_3560G24PS_24_Ports_Switch_61','Cisco WS-C3560G-24PS-S Catalyst 3560G-24PS 24 Ports Switch','<ul>\r\n	<li>Fixed-configuration, enterprise-class switches that include IEEE 802.3af and Cisco prestandard Power over Ethernet (PoE) functionality in Fast Ethernet and Gigabit Ethernet configurations</li>\r\n	<li>Ideal access layer switch for small enterprise LAN access or branch-office environments</li>\r\n	<li>Combining both 10/100/1000 and PoE configurations for maximum productivity and investment protection</li>\r\n	<li>Enables the deployment of new applications such as IP telephony, wireless access, video surveillance, building management systems, and remote video kiosks</li>\r\n	<li>Networkwide intelligent services-such as advanced quality of service (QoS), rate limiting, access control lists (ACLs), multicast management, and high-performance IP routing-while maintaining the simplicity of traditional LAN switching</li>\r\n</ul>\r\n','250000'),(62,62,1563857813,'Home.jpg',1563857823,1563857903,1,17,25,0,0,'HP_LaserJet_Pro_MFP_M477fnw_62','HP LaserJet Pro MFP M477fnw','<h5>Description du produit</h5>\r\n\r\n<h2>HP LaserJet Pro MFP M477fnw imprimante multifonction multifonction - Black, Cyan, Magenta, Jaune caract&eacute;ristiques</h2>\r\n\r\n<p>Des performances d&#39;impression, de num&eacute;risation, de copie et de t&eacute;l&eacute;copie sans pareil et une s&eacute;curit&eacute; compl&egrave;te et renforc&eacute;e adapt&eacute;e &agrave; votre fa&ccedil;on de travailler. Cette imprimante couleur multifonction accomplit vos principales t&acirc;ches plus rapidement et offre une protection efficace contre les menaces. Les toners HP authentiques avec JetIntelligence permettent d&#39;imprimer plus de pages.<br />\r\n<br />\r\n<b>Effectuez les t&acirc;ches rapidement. Contribuez &agrave; la protection des donn&eacute;es.</b><br />\r\n&bull; Num&eacute;risez des fichiers num&eacute;riques directement vers des e-mails, une cl&eacute; USB, des dossiers