cute;s. Remplacez-les par des cartouches grande capacit&eacute; en option.<br />\r\n<br />\r\n<b>Restez connect&eacute; gr&acirc;ce &agrave; des options d&#39;impression mobile simples &agrave; utiliser</b><br />\r\n&bull; Imprimez facilement &agrave; partir d&#39;une grande vari&eacute;t&eacute; de smartphones et de tablettes, ne n&eacute;cessitant g&eacute;n&eacute;ralement aucune configuration ni application.<br />\r\n&bull; Profitez de l&#39;impression directe sans fil au bureau (depuis des p&eacute;riph&eacute;riques portables), sans acc&eacute;der au r&eacute;seau de l&#39;entreprise.<br />\r\n&bull; Acc&eacute;dez facilement &agrave; vos ressources, puis imprimez-les et partagez-les gr&acirc;ce &agrave; la connectivit&eacute; Ethernet et &agrave; la mise en r&eacute;seau sans fil.</p>\r\n\r\n<p>HP LaserJet Pro MFP M477fnw, Laser, 600 x 600 DPI, 1200 x 1200 DPI, A4, 216 x 356 mm, Couleur</p>\r\n','320000'),(63,63,1578637299,'s-l1600_Image_Tete.jpg',1578637807,1597329439,1,10,5,0,0,'HP_Pavilion_All_in_One_27_Pouces_63','HP Pavilion All in One 27 Pouces','<ul>\r\n	<li>HP Pavilion All-in-One 27-xa0077c</li>\r\n	<li>(TOUCHSCREEN)Windows 10</li>\r\n	<li>Intel Core i7-8700T 6-core Processor 2.40GHz</li>\r\n	<li>16GB DDR4-2666 SDRAM memoire (2 x 8GB)</li>\r\n	<li>Intel UHD Graphics 630 (Integrated)</li>\r\n	<li>1TB 7200RPM SATA hard drive</li>\r\n	<li>HP TrueVision FHD Camera</li>\r\n	<li>NO OPTICAL DRIVE</li>\r\n	<li>10-point touch-enabled 27-inch diagonal widescreen Full HD IPS WLED-backlit micro edge display (1920 x 1080)</li>\r\n	<li>10/100/1000 Base-T Network</li>\r\n	<li>Wireless LAN 802.11a/b/g/n/ac (2x2) and Bluetooth 4.2 M.2</li>\r\n	<li>HP 3-in-1 Media Card Reader</li>\r\n	<li>B&amp;O PLAY (Tuned stereo speakers)</li>\r\n	<li>HP clavier sans fil avec contr&ocirc;le du volume et souris optique</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>120W external AC power adapter</li>\r\n	<li>HP Pavilion All-in-One 27-xa0077c</li>\r\n	<li>(TOUCHSCREEN)Windows 